import React from 'react';

const Hello = (props) => {
	return (
		<div>
			<p>
				Hello {props.name}, are you {props.age} years old.
			</p>
		</div>
	);
};

const App = () => {
	const name = 'Bashir';
	const age = '18';
	return (
		<div>
			<h1>Greeting</h1>
			<Hello name="Maya" age={10 + 12} />
			<Hello name={name} age={age} />
		</div>
	);
};

export default App;
